#####################################################################
# includes
#####################################################################

# Mainsail
[include mainsail.cfg]

# Main MCU board
[include octopus-pro-429.cfg]

# CAN toolhead
[include fly-sht-36.cfg]

# Other hardware
[include beacon.cfg]
[include motors.cfg]
#[include adxl-rp2040.cfg]
#[include rpi.cfg]

# Macros
[include ./macros/*.cfg]

#####################################################################
# Printer
#####################################################################

[printer]
kinematics: corexy
max_velocity: 800
max_accel: 13000
max_z_velocity: 12
max_z_accel: 280
square_corner_velocity: 5.0

#####################################################################
#   X/Y Stepper Settings
#####################################################################

##  A Stepper - Left
[stepper_x]
position_endstop: 385
position_min: 0
position_max: 385
homing_speed: 50
homing_retract_dist: 5
homing_positive_dir: true

##  B Stepper - Right
[stepper_y]
position_endstop: 400
position_min: 0
position_max: 400
homing_speed: 50
homing_retract_dist: 5
homing_positive_dir: true

#####################################################################
#   Z Stepper Settings
#####################################################################

## Z0 Stepper - Rear Center
[stepper_z]
position_min: -2.5
position_max: 365
homing_speed: 10
second_homing_speed: 3
homing_retract_dist: 3

#####################################################################
#   Extruder
#####################################################################

[extruder]
rotation_distance: 22.751729   #for 5mm Shaft Driven Bondtech gearsets
gear_ratio: 50:8               #for sherpa mini 8t motor
max_extrude_only_distance: 1400.0
max_extrude_only_velocity: 75.0
max_extrude_only_accel: 1500
nozzle_diameter: 0.400
filament_diameter: 1.750
sensor_type: PT1000
pullup_resistor: 1100
min_temp: 10
max_temp: 300
min_extrude_temp: 170
min_extrude_temp: 170
max_power: 1.0
#control: pid
#pid_kp = 26.213
#pid_ki = 1.304
#pid_kd = 131.721

#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
sensor_type: Generic 3950
max_power: 0.8
#pwm_cycle_time: 0.02
min_temp: 0
max_temp: 120
#control: pid
#pid_kp: 58.437
#pid_ki: 2.347
#pid_kd: 363.769

#####################################################################
#   Temperature sensors
#####################################################################

[temperature_sensor chamber]
sensor_type: Generic 3950
min_temp: 0
max_temp: 100
gcode_id: C

#####################################################################
#   Fan Control
#####################################################################

[fan]
#kick_start_time: 0.5
##  Depending on your fan, you may need to increase this value
##  if your fan will not start. Can change cycle_time (increase)
##  if your fan is not able to slow down effectively
cycle_time: 0.15

[heater_fan hotend_fan]
#kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[temperature_fan mcu]
sensor_type: temperature_mcu
min_temp: 10
max_temp: 100
target_temp: 30
control: watermark
shutdown_speed: 0

[temperature_fan pi]
sensor_type: temperature_host
min_temp: 10
max_temp: 100
target_temp: 30
control: watermark
shutdown_speed: 0

[fan_generic rattrap]
#kick_start_time: 0.5
hardware_pwm: True
#cycle_time: 0.00004 # 25 kHz
tachometer_ppr: 2

#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################

[bed_mesh]
algorithm: bicubic
speed: 800
horizontal_move_z: 5
mesh_min: 10, 25
mesh_max: 370, 370
probe_count: 72, 69   # 5mm spacing
zero_reference_position: 192.5, 169.2

[z_tilt]
z_positions:
    193.9,370
    3.3,-1.7
    383.3,-1.7
points:
    192.5,345
    50,35
    335,35
speed: 800
horizontal_move_z: 5
retries: 5
retry_tolerance: 0.0075

#####################################################################
# Resonances
#####################################################################

[resonance_tester]
probe_points:
   193, 193, 10  # slightly above the middle of the bed

[input_shaper]
shaper_freq_x: 53.2
shaper_type_x: mzv
shaper_freq_y: 36.2
shaper_type_y: mzv

#####################################################################
# LEDs
#####################################################################

[neopixel tool0_leds]
  chain_count: 3
  color_order: GRBW
  initial_RED: 0
  initial_GREEN: 0
  initial_BLUE: 0

